import logo from './logo.svg';
import './App.css';
import Nav from '../src/components/NavBar';
function App() {
  return (
    <div className="App">

        <div>
          <Nav inf="Tareas"/>
        </div>
        <img src={logo} className="App-logo" alt="logo" />

    </div>
  );
}

export default App;
